/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div class="${classMap(context.classes.main)}"
	id="${ifDefined(context._id)}"
	role="alert"
	aria-live="assertive"
	aria-labelledby="${ifDefined(context._id)}">

	${ !context.noIcon ? block1(context) : undefined }<span class="ui5-hidden-text">${ifDefined(context.hiddenText)}</span><span class="${classMap(context.classes.label)}"><slot></slot></span>

	${ !context.noCloseButton ? block4(context) : undefined }</div>
`; };
const block1 = (context) => { return html`<div class="ui5-messagestrip-icon-wrapper">
            ${ context.iconProvided ? block2(context) : block3(context) }</div>
	`; };
const block2 = (context) => { return html`<slot name="icon"></slot>
            `; };
const block3 = (context) => { return html`<ui5-icon name="${ifDefined(context.standardIconName)}" class="ui5-messagestrip-icon"></ui5-icon>
            `; };
const block4 = (context) => { return html`<button
			class="ui5-messagestrip-close-icon-wrapper"
			title="${ifDefined(context._closeButtonText)}"
			@click=${context._closeClick}
		><ui5-icon
				class="ui5-messagestrip-close-icon"
				name="decline"
			></ui5-icon></button>
	`; };

export default block0;
